import './Catalog.css';
import Card from '../Card/Card';
import {useState, useEffect} from 'react';
// import productsApi from '../../utils/Api';
// import Product from '../Product/Product';
// import { useState, useEffect } from 'react';

export default function Catalog({ onCardClick, products, onLikeClick, savedProducts}) {



  function isSaved(things, thing) {
    return things.includes(thing)
  }

  return (
    
    <section className='catalog'>
      <ul className='catalog-list'>
        {products.map((product) => 
        
        {(
          <Card
          // product={product}
            id={product.productId}
            name={product.title}
            mainPicture={product.mainPicture}
            price={product.price}
            key={product.productId}
            onCardClick={onCardClick}
            onLikeClick={onLikeClick}
            pictures={product.pictures}
            savedProducts={savedProducts}
            isSaved={isSaved(savedProducts, product.productId)}
            // isLoggedIn={isLoggedIn}
          ></Card>
        )})}
      </ul>

    </section>
  )
}
